import { ACTIONS } from "../../actionConstants";

const userActions = {
  getUserData: (applicationData) => ({
    type: ACTIONS.GET_USER_DATA,
    payload: applicationData,
  }),
  setLoadingOn: () => ({
    type: ACTIONS.SET_LOADING_ON,
  }),
  setLoadingOff: () => ({
    type: ACTIONS.SET_LOADING_OFF,
  }),
  getUserDataRequest: () => ({
    type: GET_USER_DATA_REQUEST,
    payload: user,
  }),
};

export { userActions };
